package com.daoben.rfid.model;

import java.sql.Timestamp;



/**
 * @author 文
 *
 * @date   2017年3月9日下午7:08:51
 */
public class InfoHis {
	private String RFID_LABELNUM;
	private String ASSET_NAME;
	private String TAG_ID;
	private Timestamp OPDATE;
	private String POSITION;
	private String ASSET_TYPE;
	public InfoHis() {
		super();
		// TODO Auto-generated constructor stub
	}
	public InfoHis(String rFID_LABELNUM, String aSSET_NAME, String tAG_ID, Timestamp oPDATE, String pOSITION,
			String aSSET_TYPE) {
		super();
		RFID_LABELNUM = rFID_LABELNUM;
		ASSET_NAME = aSSET_NAME;
		TAG_ID = tAG_ID;
		OPDATE = oPDATE;
		POSITION = pOSITION;
		ASSET_TYPE = aSSET_TYPE;
	}
	public String getRFID_LABELNUM() {
		return RFID_LABELNUM;
	}
	public void setRFID_LABELNUM(String rFID_LABELNUM) {
		RFID_LABELNUM = rFID_LABELNUM;
	}
	public String getASSET_NAME() {
		return ASSET_NAME;
	}
	public void setASSET_NAME(String aSSET_NAME) {
		ASSET_NAME = aSSET_NAME;
	}
	public String getTAG_ID() {
		return TAG_ID;
	}
	public void setTAG_ID(String tAG_ID) {
		TAG_ID = tAG_ID;
	}
	public Timestamp getOPDATE() {
		return OPDATE;
	}
	public void setOPDATE(Timestamp oPDATE) {
		OPDATE = oPDATE;
	}
	public String getPOSITION() {
		return POSITION;
	}
	public void setPOSITION(String pOSITION) {
		POSITION = pOSITION;
	}
	public String getASSET_TYPE() {
		return ASSET_TYPE;
	}
	public void setASSET_TYPE(String aSSET_TYPE) {
		ASSET_TYPE = aSSET_TYPE;
	}
	
	
}
